import React, { Component } from "react";
import Contacts from "./components/contacts";

import "./App.css";

class App extends Component {
  state = {
    contacts: [],
    hasErrors: false,
  };

  componentDidMount() {
    fetch("https://api.github.com/search/issues?q={hello-world-react}") //"http://jsonplaceholder.typicode.com/users"
      .then((res) => res.json())
      .then((data) => {
        this.setState({ contacts: data });
      })
      .catch(() => this.setState({ hasErrors: true }));
  }

  render() {
    console.log(this.state.contacts);
    return (
      <div className="App">
        <Contacts contacts={this.state.contacts} />
      </div>
    );
  }
}

export default App;

